export const NavbarCSS = {
  appbar: { backgroundColor: "#304FA1", px: "50px" },

  image: {
    flex: 1,
    display: "flex",
    alignItems: "center",
    height: "120px",
  },
  
  borderDiv: {
    paddingTop: 1,
    paddingBottom: 1,
    backgroundColor: "#fff",
    position: "absolute",
    bottom: 0,
    width: "0%",
    WebkitTransition: "all 0.5s",
    transition: "all 0.5s",
    transitionTimingFunction: "ease",
  },
  borderDivHover: {
    width: "80%",
    transitionTimingFunction: "ease",
  },
};
